import React, { useEffect, useState, useContext } from "react";
import "../Dashboard/dashboard.css";
import axios from "axios";
import Deposit from "./Deposit";
import FundTransfer from "./FundTransfer";
import { useNavigate, useLocation } from "react-router-dom";
import { AccountContext } from "../Context/AccountProvider";
import "../Dashboard/Transaction/transaction.css";
import Loan from "./Loan";
import Transaction from "./Transaction/Transaction";

function Dashboard() {
  const { account, setAccount } = useContext(AccountContext);
  const [loading, setLoading] = useState(true);
  const [userDetail, setUserDetails] = useState({});
  const [depositPopUp, setDepositPopUp] = useState(false);
  const [fundTransferPopUp, setFundTransferPopUp] = useState(false);
  const [transactions, setTransactions] = useState([]);
  const [loanPopUp, setLoanPopUp] = useState(false);
  const [error, setError] = useState(null);
  const location = useLocation();
  const navigate = useNavigate();

  useEffect(() => {
    console.log("Dashboard component mounted");
    const { JWTaccount, SetJWTuser } = location.state || {};
    console.log("JWTaccount:", JWTaccount, "SetJWTuser:", SetJWTuser);

    let userId;
    if (SetJWTuser && SetJWTuser.userId) {
      userId = SetJWTuser.userId;
      console.log("Setting userId in sessionStorage:", userId);
      sessionStorage.setItem("userId", userId);
    } else {
      userId = sessionStorage.getItem("userId");
      console.log("Retrieved userId from sessionStorage:", userId);
    }

    const token = localStorage.getItem("authToken");
    console.log("Retrieved token from localStorage:", token);

    if (JWTaccount) {
      console.log("Using JWTaccount data");
      setAccount(JWTaccount);
      setUserDetails(SetJWTuser);
      setLoading(false);
    } else {
      if (userId && token) {
        fetchAccountData(userId, token);
        fetchUserDetails(userId, token);
      } else {
        console.error("No userId or token found");
        setError("Authentication data missing");
        setLoading(false);
      }
    }

    // Fetch transactions regardless of data source
    if (userId && token) {
      fetchTransactions(userId, token);
    }
  }, []);

  const fetchAccountData = (userId, token) => {
    console.log("Fetching account data");
    axios
      .get(`http://localhost:8080/api/account/userid/${userId}`, {
        headers: { Authorization: `Bearer ${token}` },
      })
      .then((response) => {
        console.log("Account data received:", response.data);
        setAccount(response.data);
        setLoading(false);
      })
      .catch((error) => {
        console.error("Error fetching account data:", error);
        setError("Failed to fetch account data");
        setLoading(false);
      });
  };

  const fetchUserDetails = (userId, token) => {
    console.log("Fetching user details");
    axios
      .get(`http://localhost:8080/api/users/${userId}`, {
        headers: { Authorization: `Bearer ${token}` },
      })
      .then((response) => {
        console.log("User details received:", response.data);
        setUserDetails(response.data);
      })
      .catch((error) => {
        console.error("Error fetching user details:", error);
        setError("Failed to fetch user details");
      });
  };

  const fetchTransactions = (userId, token) => {
    console.log("Fetching transactions for userId:", userId);
    axios
      .get(`http://localhost:8080/api/transaction/${userId}`, {
        headers: { Authorization: `Bearer ${token}` },
      })
      .then((response) => {
        console.log("Transactions received:", response.data);
        setTransactions(response.data);
      })
      .catch((error) => {
        console.error("Error fetching transactions:", error);
        setError("Failed to fetch transactions");
      });
  };

  console.log("Rendering Dashboard component, transactions:", transactions);

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error}</div>;
  }

  if (!account || Object.keys(account).length === 0) {
    return <div>No account data available.</div>;
  }

  // const userId = sessionStorage.getItem("userId");

  console.log("Rendering Dashboard component, transactions:", transactions);

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error}</div>;
  }

  if (!account || Object.keys(account).length === 0) {
    return <div>No account data available.</div>;
  }

  const userId = localStorage.getItem("userId");

  return (
    <div
      className={
        depositPopUp || fundTransferPopUp || loanPopUp
          ? "Dashboard dashboard-blur"
          : "Dashboard"
      }
    >
      <div className="dashboard-page-border">
        <div className="page-size">
          <div className="dashboard-hr"></div>
          <div className="nav-bar">
            <div className="dashbord-un-bn">
              <span className="dashboard-logo">logo</span>
              <span className="dashbord-bank-name">Easy Online Banking</span>
              <span className="dashbord-userName">
                Hi, {userDetail.first_Name}
              </span>
              <div className="dashbord-user-img">ðŸ‘¤</div>
            </div>
            <div className="dashboard-hr"></div>
            <div className="navbar-page">
              <div className="nav-bar-data">
                <button
                  className="dashboard sidebtn"
                  onClick={() => navigate(`/dashboard/${userId}`)}
                >
                  Dashboard
                </button>
                <button
                  className="loan sidebtn"
                  onClick={() => setLoanPopUp(true)}
                  onMouseOut={() => console.log("mouse working")}
                >
                  Loan
                </button>
                <button
                  className="cards sidebtn"
                  onClick={() => navigate("/card")}
                >
                  Cards
                </button>
                <button
                  onClick={() => setDepositPopUp(true)}
                  className="deposit sidebtn"
                >
                  Deposit
                </button>
                <button
                  className="fund sidebtn"
                  onClick={() => setFundTransferPopUp(true)}
                >
                  {" "}
                  Fund Transfer
                </button>
                <button className="bell sidebtn">Log out</button>
              </div>
            </div>
            {/* Rest of your dashboard content */}
            {/* <div className="acc-bal"></div> */}
            <div className="account-test">
              <div className="dashbord-account-Balance">
                <p className=" amount">Account Balance: {account.accBalance}</p>
              </div>
              <div className="account">
                <div className="dashboard-account-Details">
                  <div className="user-detail">
                    {/* <p>
                    User Name:{" "}
                    {userDetail.first_Name + " " + userDetail.last_Name}
                  </p> */}
                    <p>Account Number: {account.accNumber}</p>
                    {/* <p>Account Type: {account.accType}</p> */}
                    <p>Account Created Date: {account.accCreatedAt}</p>
                  </div>
                </div>
              </div>
            </div>
            <div className="dashboard-trans-border">
              <p className="transaction-header" key={account.accNumber}>
                Transaction History
              </p>
              {/* <div className="dashboard-hr"></div>   */}
              <div className="transaction">
                <table className="transaction-table table">
                  <thead className="tr-position">
                    <tr className="tr-position">
                      <th className="transaction-table sl-no ">Sl No.</th>
                      <th className="transaction-table details">
                        Transaction Details
                      </th>
                      <th className="transaction-table trans-amount">Amount</th>
                      <th className="transaction-table balance">Balance</th>
                      <th className="transaction-table date">Date</th>
                    </tr>
                  </thead>
                  {transactions.length > 0 ? (
                    transactions.map((transaction, index) => (
                      <Transaction
                        key={transaction.transactionID}
                        transaction={transaction}
                        index={index}
                      />
                    ))
                  ) : (
                    <tbody>
                      <tr>
                        <td colSpan="5" className="no-transaction">
                          No Transactions Available
                        </td>
                      </tr>
                    </tbody>
                  )}
                </table>
              </div>
            </div>
          </div>
          {/* <Transaction transactions={transactions} /> */}
          {depositPopUp && <Deposit setDeposit={setDepositPopUp} />}
          {fundTransferPopUp && (
            <FundTransfer setFundTransfer={setFundTransferPopUp} />
          )}
          {loanPopUp && <Loan setLoan={setLoanPopUp} />}
          {/* {<Transaction transactions={transactions} />} */}

          <div className="dashboard-hr"></div>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
